import {Routes, Route} from 'react-router-dom'
import HomePage from '../pages/HomePage';
import TodoPage from '../pages/TodoPage';

const Router = () => {
    return (
        <Routes>
            <Route path='/' element={<HomePage/>} />
            <Route path='/todo' element=<TodoPage/> />
        </Routes>
    );
}

export default Router
